import 'package:flutter/material.dart';

void main() {
  runApp(const MyApp());
}
class MyApp extends StatelessWidget {
  const MyApp({super.key});
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      debugShowCheckedModeBanner: false,
      title: 'Flutter Demo',
      theme: ThemeData(
        colorScheme: ColorScheme.fromSeed(seedColor: Colors.deepPurple),
        useMaterial3: true,
      ),
      home: MyHomePage(title: 'Flutter Demo Home Page'),
    );
  }
}

class MyHomePage extends StatefulWidget {
  MyHomePage({super.key, required this.title});
  final String title;

  @override
  State<MyHomePage> createState() => _MyHomePageState();
}

class _MyHomePageState extends State<MyHomePage> {
  int _counter = 0;

  void _incrementCounter() {
    setState(() {
      _counter++;
    });
  }

  @override
  Widget build(BuildContext context) {
    var screenwidth = MediaQuery.of(context).size.width;
    var screenheight = MediaQuery.of(context).size.height;
    var orientation = MediaQuery.of(context).orientation;
    return Scaffold(appBar: AppBar(title: Text("PAGE DESIGN"),backgroundColor: Colors.deepPurpleAccent),
      body: screenwidth>467 ? tabletHomePage(screenwidth,screenheight):phoneHomePage(screenwidth,screenheight),
    );
  }
  Widget tabletHomePage(double screenwidth,double screenheight,){
    return Container(height:screenheight ,width: screenwidth,color: Colors.black12,child:

    GridView.builder(
      itemCount: 18,
      gridDelegate: screenwidth<=467?
      SliverGridDelegateWithFixedCrossAxisCount(
        mainAxisSpacing: 10,crossAxisSpacing: 10,childAspectRatio: 3/1,crossAxisCount: 1,)
      :screenwidth <=991?
      SliverGridDelegateWithFixedCrossAxisCount(
        mainAxisSpacing: 10,crossAxisSpacing: 10,childAspectRatio: 4/2,crossAxisCount: 2,):
      SliverGridDelegateWithFixedCrossAxisCount(
        mainAxisSpacing: 10,crossAxisSpacing: 10,childAspectRatio: 10/3,crossAxisCount: 3,),
      itemBuilder: (context, index) {
      return
        Column(children: [Padding(padding: EdgeInsets.all(20)),
          TextField(decoration: InputDecoration(border: OutlineInputBorder(borderRadius: BorderRadius.circular(33))),),
        ],);
    },)
    );
  }
  Widget phoneHomePage(double screenwidth,double screenheight,){
    return Container(height:screenheight ,width: screenwidth,color: Colors.grey,padding: EdgeInsets.all(22),child: Column(
      children: [
        TextField(decoration: InputDecoration(border: OutlineInputBorder(borderRadius: BorderRadius.circular(33)),hintText: "NAME"),),
        Padding(padding: EdgeInsets.all(15)),
        TextField(decoration: InputDecoration(border: OutlineInputBorder(borderRadius: BorderRadius.circular(33)),hintText: "FATHER NAME"),),
        Padding(padding: EdgeInsets.all(15)),
        TextField(decoration: InputDecoration(border: OutlineInputBorder(borderRadius: BorderRadius.circular(33)),hintText: "MOTHER NAME"),),
        Padding(padding: EdgeInsets.all(15)),
        TextField(decoration: InputDecoration(border: OutlineInputBorder(borderRadius: BorderRadius.circular(33)),hintText: "PHONE NO"),),
        Padding(padding: EdgeInsets.all(15)),
        TextField(decoration: InputDecoration(border: OutlineInputBorder(borderRadius: BorderRadius.circular(33)),hintText: "ADDRESS"),),
        Padding(padding: EdgeInsets.all(15)),
        TextField(decoration: InputDecoration(border: OutlineInputBorder(borderRadius: BorderRadius.circular(33)),hintText: "EMAIL"),),
        Padding(padding: EdgeInsets.all(15)),
        FilledButton(onPressed: () {
          return setState(() {

          });
        }, child: Text("SUBMIT")),

      ],
    ),);
  }
}







